import React from 'react';
import {Link} from "react-router-dom";

const SideBar = () => {
    return (
        <ul>
            <li>
                <NavLink to="/admin/posts" >Posts</NavLink>
            </li>
            <li>
                <Link to="/admin/users">Users</Link>
            </li>
        </ul>
    );
};

export default SideBar;
